import React, {Component} from 'react';
import './Contact.css';

import {Form,FormGroup,Label,Input,
        Container,Row,Col} from 'reactstrap';

class Contact extends Component{

    render(){
        return(
            <div className="Contact-container">
                <h1 className="Name contact">C O N T A C T</h1>
                <div className="contact-content">
                   <Container fluid={true}>
                       <Row > 
                           <Col sm={{ size: 5, order: 2, offset: 1 }}>
                                <div className="contact-info">
                                    {/** 
                                       put email (not WSU), linked-in, instagram, resume, github 
                                    */}
                                </div>
                           </Col>
                           <Col sm={{ size: 7, order: 1, offset: 1 }}>
                                <div className="contact-info2">
                                    <Form>
                                        <FormGroup>
                                            <Label className="label" for={"firstName"}> First Name </Label>
                                            <Input type="text" name="first_name" id="firstName"></Input>
                                        </FormGroup>

                                        <FormGroup>
                                            <Label className="label" for={"lasttName"}> Last Name </Label>
                                            <Input type="text" name="last_name" id="lastName"></Input>
                                        </FormGroup>



                                    </Form>
                                </div>
                           </Col>
                       </Row>
                   </Container>

                </div>

            </div>
        ); 
    }

}

export default Contact;
